import React from "react"
import MBUX from "assets/images/MBUX.jpg"
import { Card, CardMedia, Grid, Typography } from "@mui/material"
import { Box } from "@mui/system"

function App() {
  const styles: React.CSSProperties = {
    card: {},
    textContainer: {
      padding: "16px",
    },
  }
  const MbuxImage = () => {
    return <img src={MBUX} alt="MBUX" style={{ maxWidth: "100%" }} />
  }
  return (
    <Card style={styles.card}>
      <Grid>
        <MbuxImage />
        <Grid style={styles.textContainer}>
          <Typography variant="h3">Some cool work</Typography>
          <Typography variant="subtitle2">2021</Typography>
          <Typography variant="body2">This work is very cool</Typography>
        </Grid>
      </Grid>
    </Card>
  )
}

export default App
